(delegationMask, iss, aud, x5c, privateKey, handler) => { 

           console.log('getDelegationEvidence ' + JSON.stringify({
              delegationMask: JSON.stringify(delegationMask), 
              iss: iss,
              aud: aud,
              privateKey: privateKey,
              x5c: x5c,
              handler: handler !== 'undefined' ? 'handler is provided' : 'handler is not provided'
          }));

          // get an access token from ar
          eval(globals.getAccessToken)(iss, aud, x5c, privateKey, 'ar', function(err, accessToken){
              if (err === null) {
                    const delegationRequest = {
                      url: pm.variables.get('ar') + '/delegation',
                      method: 'POST',
					  header: {
						'Authorization': 'Bearer ' + accessToken,
					    'Content-Type': 'application/json'
					  },
                      body: {
                       mode: 'raw',
					   raw: JSON.stringify(delegationMask)
                      }
                    };
    				pm.sendRequest(delegationRequest, function(err, response) {
    				    if (err === null && response != null && response.code == 200) {
    				        const delegationToken = response.json().delegation_token;
    				        handler(err, delegationToken);
    				    } else {
    				        console.log('ERR!!! delegation_evidence could not be retrieved. Error: ' + err);
    				        handler(err, null);
    				    }
    				});
              }
          });
}

(iss, aud, x5c, privateKey, url, handler) => { 

           console.log('getAccessToken ' + JSON.stringify({
              iss: iss,
              aud: aud,
              privateKey: privateKey,
              x5c: x5c,
              url: url,
              handler: handler !== 'undefined' ? 'handler is provided' : 'handler is not provided'
          }));


	      pm.sendRequest(gl.createGenerateJwsRequest(iss, aud, x5c, privateKey), function (err, response) {

				if (err === null && response != null && response.code == 200) {
    				const clientAssertion = gl.arrayBufferToString(response.stream);

    				pm.sendRequest(gl.createConnectTokenRequest(url, iss, clientAssertion), function (err, response) {
    				        if (err === null && response != null && response.code == 200) {
    				            const accessToken = response.json().access_token;
    				            handler(err, accessToken);
    				        }
        					else {
        					    console.log('ERR!!! Access Token could not be retrieved. Error: ' + err);
        					    handler(err, null);
        					}
    				});
				} else {
				    console.log('ERR!!! client_assertion could not be retrieved. Error: ' + err);
				    handler(err, null);
				}
			});

}

(delegationMask, iss, aud, x5c, privateKey, url) => {
    eval(globals.getAccessToken)(iss, aud, x5c, privateKey, url, function(err, accessToken){

        if (accessToken != null)
        {
            pm.variables.set('access_token', accessToken); 

            eval(globals.getDelegationEvidence)(delegationMask, iss, 'ar.client_id', x5c, privateKey, function(err, response){

                    var delegationEvidence = response || "no valid delegation evidence";

                    pm.variables.set('delegation_evidence', delegationEvidence);
                }
            );
        }
    }
  );
}

(key, value) => { 
